        private static List<string> GetCollection(int entries, Func<int, Random, string> item)
        {
            Random seed = new Random(DateTime.Now.Millisecond);
            List<string> collection = new List<string>(entries);

            object block = new object();
            Loops.Loop(0, entries, i =>
            {
                var _item = item(i, seed);
                lock (block)
                    collection.Add(_item);
            });

            return collection;
        }

        public static List<string> Phone(int entries)
        {
            return GetCollection(entries, (i, seed)
                => string.Format("{0:d4}-{1:d4}", seed.Next(0, 9999), seed.Next(0, 9999)));
        }
        public static List<string> Address(int entries)
        {
            return GetCollection(entries, (i, seed) => string.Format("{0}, {1} - {2}"
                , _addresses[seed.Next(0, _addresses.Count)]
                , _cities[seed.Next(0, _cities.Count)]
                , _state[seed.Next(0, _state.Count)]
            ));
        }
        public static List<string> Name(int entries)
        {
            return GetCollection(entries, (i, seed) => string.Format("{0} {1}"
                , _firstNames[seed.Next(0, _firstNames.Count)]
                , _lastNames[seed.Next(0, _lastNames.Count)]
            ));
        }
